    constructor(props) {
        super(props);

        this.state = {
            high_temp: 100,
            low_temp: 0,
            day: "Monday",

        };
    }

    render() {

        return (
            <div className="weather-widget">
                <h1 align="center">Whattup</h1>
                <img src={sunny}/>
            </div>
        );

    }

}

export default WeatherComp;
